import Tablists from "./Tablists";

const Tabs = () => {

    return (
        <>
            <h1>Tabs</h1>
            <container>
                <Tablists>
                    <div label={"tab1"}>
                        tab content 1
                    </div>
                    <div label={"tab2"}>
                        tab content 2
                    </div>
                    <div label={"tab3"}>
                        tab content 3
                    </div>
                </Tablists>

            </container>
        </>
    )
}

export default Tabs;
